DROP DATABASE IF EXISTS PUMPEXAMPLE;
CREATE DATABASE PUMPEXAMPLE;
USE PUMPEXAMPLE;

DROP TABLE IF EXISTS PumpExample;

CREATE TABLE PumpExample (
  S_T_C 		decimal(12,8) DEFAULT NULL,
  S_Pin_kPa 	decimal(12,8)  DEFAULT NULL,
  S_F_kgh 		decimal(12,8)  DEFAULT NULL,
  S_E_kW 		decimal(12,8)  DEFAULT NULL,
  S_Pout_kPa 	decimal(12,8)  DEFAULT NULL
) ;





SELECT * FROM PumpExample;
